import React, { Component } from "react";
import {
  Form,
  Button
} from "react-bootstrap";

class Login extends Component {
  constructor(props) {
      super (props);
      this.state = {};
  }

  getLogin(event) {
      fetch('http://localhost:8000/paideia/default/login/auth_user/1', {
          method: "GET",
          mode: "no-cors",
          cache: "no-cache",
          credentials: "include"
        })
        .then(response => response.json())
        .then(function(myJson) {
          console.log(JSON.stringify(myJson));
        })
        event.preventDefault();
  }

  render() {
    return(
      <form onSubmit={this.getLogin}>
        <Form.Group controlId="loginEmail">
          <Form.Label>Email Address</Form.Label>
          <Form.Control type="email" placeholder="Enter your email address"></Form.Control>
          <Form.Text className="text-muted">Some instruction</Form.Text>
        </Form.Group>
        <Form.Group controlId="loginPassword">
          <Form.Label>Password</Form.Label>
          <Form.Control type="password" placeholder="Password"></Form.Control>
          <Form.Text className="text-muted">Some instruction</Form.Text>
        </Form.Group>
        <Button variant="primary" type="submit">Log in</Button>
      </form>
    );
  }
}

export default Login;
